import React, { Component } from "react";
import AudioPlayer from "react-h5-audio-player";

let playlist = [
  { src: "/audio/CASE.mp3", title: "CASE", artist: "Lea Hughes" },
  { src: "/audio/BRIDGE.mp3", title: "Bridge", artist: "Lea Hughes" }
];

export default class Listen extends Component {
  render() {
    const Player = () => (
      <AudioPlayer
        autoPlay
        src="./audio/BRIDGE.mp3"
        onPlay={e => console.log("onPlay")}
      />
    );

    return (
      <div>
        <AudioPlayer audioFiles={playlist} />
        <div className="react-h5-audio-player flex">
          <div className="react-h5-audio-player flex toggle-play-wrapper">
            <div className="react-h5-audio-player flex progress-bar-wrapper"></div>
          </div>
        </div>
        <h2>Yes I, the H2 is working</h2>
      </div>
    );
  }
}
